import React from "react";
import "./New_movement.css";

function New_movement(){
    return(
        <>
        <div className="Outer_div">
            <div className="inner_div">
                <button>
                <ion-icon name="add-circle"></ion-icon>
                New Movement
                </button>
                

            </div>
            </div></>

    );
}
export default New_movement;
